
-- CRIANDO TABELA
CREATE TABLE t_restaurante (
    id_rest         NUMBER(6) NOT NULL,
    ds_img_rest     VARCHAR2(180) NOT NULL,
    nm_rest         VARCHAR2(100) NOT NULL,
    nr_rat_rest  VARCHAR2(10) NOT NULL,
    ds_tipo_rest    VARCHAR2(12) NOT NULL,
    nr_dist_rest    VARCHAR2(12) NOT NULL,
    ds_prazo_rest   VARCHAR2(15) NOT NULL,
    ds_frete_rest   VARCHAR2(12) NOT NULL,
    ds_desc_rest    VARCHAR2(40) NOT NULL,
    ds_url_rest     VARCHAR2(180) NOT NULL,
    nm_end_ori          VARCHAR2(200) NOT NULL
);

-- CRIANDO CHAVE PRIMÁRIA

ALTER TABLE t_restaurante ADD CONSTRAINT t_restaurante_pk PRIMARY KEY ( id_rest );

-- CRIANDO SEQUENCE

CREATE SEQUENCE restaurante_seq
  MINVALUE 1
  MAXVALUE 999999999999999999999999999
  START WITH 1
  INCREMENT BY 1
  CACHE 20;

